import React from "react";
import ConfigFooter from '../capas/footer/footer';
import ConfigHead from '../capas/head/head';
import  Cv from '../componentes/cv.png';
import  Cvingles from '../componentes/cvingles.png';

const Curriculum = () => {
    return(
    <>
        <ConfigHead/>
        <div className="proyectos">
        <div className="proyectito">
            <div className="lineaProyecto">
                <h3 className="proyecto">Proyecto Carpinchos </h3>
                </div> 
                 
                </div> 
        <div className="proyectito">
            <div className="lineaProyecto">
                <h3 className="proyecto">Proyecto Front </h3>
                </div> 
                 
                </div> 
        </div>
        <ConfigFooter/>
    </>
    )
};

export default Curriculum;
